import React from 'react';
import './popup.styles.scss';

const Popup = () => {
    return(
        <div className='modal'>
            <div className='modal-content'>
                <span className='close'>&times;</span>
                <p>I'm a popup!</p>
            </div>
        </div>
    );
}

export default Popup;
